"use strict";Vue.component("ht-label-select",{data:function(){return{value:""}},methods:{change_select:function(e){this.$emit("change",e)},operate_arr:function(){var t=this;this.options.forEach(function(e){t.showValue&&(e.label=e.value+" "+e.label)})}},mounted:function(){this.operate_arr()},props:{options:{type:Array,default:function(){return[]}},disabled:{default:function(){return!1}},showValue:{default:function(){return!1}},width:{default:function(){return 100}},title:{}},template:'\n    <div :style={width:width}>\n        <i-select v-model="value" filterable clearable :disabled="disabled" @on-change="change_select(value)">\n            <i-option v-for="item in options" :value="item.label" :key="item.value"> {{ item.label }}</i-option>\n        </i-select>\n    </div>\n    '});